limerick_list.text:
We got wind of John's dehonestation;
He's dishonored, disgraced by temptation.
About five or six chicks
Have resisted his tricks;
All he scored was polite conversation.

"You can talk!?" Balaam gasped, staff in hand.
"Had no choice," said his ass. "I was banned
By a sword from the path;
You're unsubtle in wrath;
And broad hints you do not understand."

He embezzled her every last cent;
Smooth and easy, he wouldn't relent.
Her life savings, her dream,
Slowly sailed down the stream;
It was knowingly, flowingly spent.

Saint Adelaide's pure hagiography
Is empty of sleaze or pornography:
Otto 1 was her honey;
Otto 2 was her sonny;
But she left us no Otto biography.

Mr. President, now you're elected,
Some adultlike behavior's expected:
Just kiss babies, not moms;
Speak of peace, not of bombs;
And don't cry when your plans get rejected.
